                                                LEFT JOIN employee e ON e.employee_id=sv.employee_id
                                                LEFT JOIN `user` vu ON vu.user_id=sv.verified_by
                                                LEFT JOIN `user` ue ON ue.user_id=e.user_id
                                                LEFT JOIN `company` com ON com.company_id = u.company_id
